import React, {Component} from 'react';
import './App.css';
import Header from './components/Headers/Header'
import Menu from './components/Headers/Menu'
import Banners from './components/Body/Banners'
import Product1 from './components/Body/Product1'
import Product2 from './components/Body/Product2'
import Banners01 from './components/Body/Banners01'
import Footer from './components/Footer';

class App extends Component {
render() {

  return (
    <div className="App">
       <Header />
      <Menu/>
      <Banners/>
      <Product1/>
      <Product2/>
      <Banners01/>
      <Footer/>
    </div>
  );
 }
}

export default App;
